	public void Animation() {
        EventQueue.invokeLater(new Runnable() {
            @Override
            public void run() 
            {

                try {
                    UIManager.setLookAndFeel(UIManager.getSystemLookAndFeelClassName());
                } catch (ClassNotFoundException e) {
                    // TODO Auto-generated catch block
                    e.printStackTrace();
                } catch (InstantiationException e) {
                    // TODO Auto-generated catch block
                    e.printStackTrace();
                } catch (IllegalAccessException e) {
                    // TODO Auto-generated catch block
                    e.printStackTrace();
                } catch (UnsupportedLookAndFeelException e) {
                    // TODO Auto-generated catch block
                    e.printStackTrace();
                }

                Main m = new Main();
                GeometryFactory geometryFactory = JTSFactoryFinder.getGeometryFactory( null );
                WKTReader reader = new WKTReader( geometryFactory );

                String s = m.during_period_poly(1000.0, 2000.0, "POLYGON((0 0, 0 8, 2 8, 2 2, 4 2, 4 8, 6 8, 6 0))", "POLYGON((6 8, 6 0, 4 0, 4 6, 2 6, 2 0, 0 0, 0 8))", 1000, 2000, 1000);

                MultiPolygon m_polygon = null;

                try {
                    m_polygon = (MultiPolygon) reader.read(s);        			
                }catch(Exception e) {

                }

                JFrame frame = new JFrame("Morphing");
                frame.getContentPane().setBackground(Color.white);
                frame.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);
                frame.add(new IFrame(m_polygon));
                frame.pack();
                frame.setLocationRelativeTo(null);
                frame.setVisible(true);
            }
        });
    }
	
    public class IFrame extends JPanel 
    {
        /**
		 * 
		 */
		private static final long serialVersionUID = 1L;
		
		private int geom = 0;
        private int N = 0;
        private MultiPolygon col = null;
        Timer timer = null;

        public IFrame(MultiPolygon m_polygon) 
        {
        	col = m_polygon;
        	N = col.getNumGeometries();
        	
        	super.setBackground(Color.white);
        	
            timer = new Timer(16, new ActionListener() {
                @Override
                public void actionPerformed(ActionEvent e) {
                    repaint();
                }
            });
            
            timer.start();
        }

        @Override
        public Dimension getPreferredSize() {
            return new Dimension(800, 600);
        }

        @Override
        protected void paintComponent(Graphics g) 
        {
            super.paintComponent(g);
            
            Polygon p = (Polygon) col.getGeometryN(geom);
            geom++;
        	
            Graphics2D gr = (Graphics2D) g.create();
            
	    AffineTransform at = new AffineTransform();
	    at.translate(100, 400);
	    at.scale(20, -20);
	        
            gr.setColor(Color.blue);
            gr.fill(new LiteShape(p, at, false));
	    gr.draw(new LiteShape(p, at, false));     
	        
            gr.dispose();
            
            if(geom >= N) {
            	timer.stop();
            	return;    	
            }
        }
    }
